 function coord(recorrido){
  var puntos = [];
  for ( var i = 0; i < ( recorrido.length-1) ; i = i+2) {
    var punto = new google.maps.LatLng(recorrido[i+1],recorrido[i]);
    puntos.push(punto);
  };
  return puntos;
}

function perteneceAlRadio(reco, point,radio,pointHasta){
        var radioD = (0.0010736987954231836*radio)/100;
        var i = 0;
        var distanciaa=0 ;
        var aux=0;
        var aux2=0;
        var distAux=0;
        var mejorHastaMomento=99999999999.99;
        while (i < reco.length - 3 ) {
            if(intersect(reco[i], reco[i + 1],reco[i+2], reco[i + 3],point.lng(),point.lat(),radioD)){
                var puntoMed= puntoMedio(Xaux1, Yaux1, Xaux2, Yaux2);
                distanciaa= distanciaa + distancia(puntoMed.lng(),puntoMed.lat(), reco[i + 2], reco[i + 3]);
                aux = i;
                i=i+2;
                while(i < reco.length - 3 ){
                    distanciaa= distanciaa + distancia(reco[i], reco[i + 1], reco[i + 2], reco[i + 3]);
                    if(intersect(reco[i], reco[i + 1],reco[i+2], reco[i + 3],pointHasta.lng(),pointHasta.lat(),radioD)){
                        var puntoMedHa= puntoMedio(Xaux1, Yaux1, Xaux2, Yaux2);
                        distanciaa= distanciaa - distancia(reco[i], reco[i + 1], reco[i + 2], reco[i + 3]);
                        distanciaa= distanciaa + distancia( reco[i], reco[i + 1],puntoMedHa.lng(),puntoMedHa.lat());
                            if(distanciaa<=mejorHastaMomento) {
                                mejorHastaMomento = distanciaa;
                            }
                    }
                    i=i+2;
                    
                }

                i=aux;
            }

            distanciaa=0;
            i = i + 2;
        }
        if(mejorHastaMomento==99999999999.99)
            return -1;
        else{
          return  mejorHastaMomento;
        }
    }

      function retornoMinimo( linea,  dist, reco){
        if(dist< mejor[1]){
            mejor = [linea,dist];
            mejorRecorrido = reco;
        }
    }

  function intersect(xp, yp, xq,  yq,  xC, yC,  rad){
        var  X=xC; //centro
        var Y= yC; //centro
        var radio= rad;
        var Xp= xp ;
        var Yp= yp;

        var Xq= xq;
        var Yq= yq;

        var m = (Yq-Yp)/(Xq-Xp);
        //System.out.println("m:"+m);
        var c= Yq-m*Xq;
        //System.out.println("c:"+c);

        var a= m*m;
        //System.out.println("m²:"+a);

        var b= 2*m*(c-Y);
        //System.out.println("b:"+b);
        var cPol= (c-Y)*(c-Y);
        //System.out.println("c:"+cPol);
        cPol= cPol-(radio*radio)+(X*X);
        a=a+1;
        //System.out.println("a:"+a);
        b= b- 2*X;
        //System.out.println("b:"+b);
        //System.out.println("c:"+cPol);
        var ret=aplicarFormula(a, b, cPol);
         Yaux1=m*Xaux1+c;
         Yaux2=m*Xaux2+c;
        //System.out.println("y1= " +Yaux1);
        //System.out.println("y2= " +Yaux2);
        var limInf= Math.min(xp,xq);
        var limSup= Math.max(xp,xq);
        return (((limInf<=Xaux1&&Xaux1<=limSup)||(limInf<=Xaux2&&Xaux2<=limSup))&&ret);
    }

      function aplicarFormula(a,  b,  c) {
        var x1 = (-b + Math.sqrt((b * b) - 4 * a * c)) / (2 * a);
        var x2 = (-b - Math.sqrt((b * b) - 4 * a * c)) / (2 * a);
        Xaux1=x1;
        Xaux2=x2;
        //System.out.println("El valor de x1 es: " + x1);
        //System.out.println("El valor de x2 es: " + x2);
        return(!isNaN(x1)||!isNaN(x2));
    }

    /** Calcula la distancia de este punto a otro punto
   * @return la distancia en metros.
   */
   function distancia( pLongitud,  pLatitud,  p2Longitud,  p2Latitud) {
    var RADIO_TIERRA = 6371000 ; // en metros
    var dLat = (pLatitud - p2Latitud)* Math.PI / 180;  /* en radianes, para usar en sin y cos */
    var dLong = (pLongitud - p2Longitud) * Math.PI / 180; 
    var a = Math.sin(dLat/2) *
           Math.sin(dLat/2) + 
           Math.sin(dLong/2) *
           Math.sin(dLong/2) *
           Math.cos(pLatitud * Math.PI / 180) *
           Math.cos(p2Latitud * Math.PI / 180);
    var c = 2 * Math.atan2(Math.sqrt(a),Math.sqrt(1-a));
    return RADIO_TIERRA * c;
  }

function puntoMedio(  pLongitud,  pLatitud,  p2Longitud,  p2Latitud){
        var medioLong=(pLongitud+p2Longitud)/2;
        var medioLat= (pLatitud+p2Latitud)/2;
        return new google.maps.LatLng(medioLat,medioLong);
    }



 
